package main

import "fmt"

func main()  {
	fmt.Println(findAnagrams("", ""))
}
func findAnagrams(s string, p string) []int {
	logMap := make(map[int]int)
	pMap := make(map[int]int)
	for _, v := range p {
		iv := int(v-'a')
		val, ok := pMap[iv]
		if ok {
			pMap[iv] = val + 1
		} else {
			pMap[iv] = 1
		}
	}
	for _, v := range s {
		iv := int(v-'a')
		logMap[iv] = 0
	}

	res := make([]int, 0)	
	for i, v := range s {
		iv := int(v - 'a')
		logMap[iv] = logMap[iv] + 1
		index := i - len(p) + 1
		if index >= 0 {
			if contains(logMap, pMap) {
				res = append(res, index)
			}
			logMap[int(s[index] - 'a')] = logMap[int(s[index] - 'a')] - 1
		}

	}
	return res
}

func contains(logMap, pMap map[int]int) bool {
	for k, v := range pMap {
		val, ok := logMap[k]
		if !ok {
			return false
		}
		if val != v {
			return false
		}
	}
	return true
}